import React from 'react';
//import { BrowserRouter as Router, Route, Switch, Link } from 'react-router-dom';
import '../components/Home.scss'
import { FormInputs } from '../components/Contact.jsx'
import image1 from '../assets/img/home/82fcd3_2ac0ed473d464d64a8cbc78a1df577b4_mv2_d_4725_2372_s_2.webp'


let formClass = "contact-form contact-form__light"

export const Home = () => {
    return (
        <>
        <img src={image1} className="back-img back-img__1" alt="" />
        <form className={formClass}>
            <FormInputs />
        </form>
            
</>
    )
}
